import { createRouter, createWebHistory } from 'vue-router'
import HomeView from '../views/HomeView.vue'
import StudentList from "../views/students/studentlist.vue"
import AddStudent from "../views/students/addstudent.vue"
import BooksReport from "../views/report/booksreport.vue"
import AddBook from "../views/books/addbook.vue"
import BookList from "../views/books/booklist.vue"
import IssueBook from "../views/books/issuebook.vue"
import ReturnBook from "../views/books/returnbook.vue"


const routes = [
  {
    path: '/StudentList',
    name: 'StudentList',
    component: StudentList
  },
  {
    path: '/AddStudent',
    name: 'AddStudent',
    component: AddStudent
  },
  {
    path: '/BooksReport',
    name: 'BooksReport',
    component: BooksReport
  },
  {
    path: '/BookList',
    name: 'BookList',
    component: BookList
  },
  {
    path: '/AddBook',
    name: 'AddBook',
    component: AddBook
  },
  {
    path: '/IssueBook',
    name: 'IssueBook',
    component: IssueBook
  },
  {
    path: '/ReturnBook',
    name: 'ReturnBook',
    component: ReturnBook
  },
  {
    path: '/',
    name: 'home',
    component: HomeView
  },
]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
